import React from "react";
import { useParams } from "react-router-dom";
const DetailsProduit=(props)=>{
    const {id}=useParams();
    return(
        <>
            <h1>{id}</h1>
            <div>
                {props.list.filtrer((e)=>e.id==id)
                .map((p)=>
                    <div>
                        <h1>{p.id}</h1>
                        <h1>{p.title}</h1>

                    </div>
                
                )
                
                }
            </div>
        </>
    )
}
export default DetailsProduit;
